import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Typography, Box } from "@material-ui/core";
import Navbar from "./Navbar";

const useStyles = makeStyles((theme) => ({
  mainContainer: {
    background: "#233",
  },
  timeline: {
    position: "relative",
    padding: "1rem",
    margin: "0 auto",
    "&:before": {
      content: "''", // need double quotes otherwise wont' work?
      position: "absolute",
      height: "100%",
      border: "1px solid tan",
      right: "40px",
      top: 0,
    },
    "&:after": {
      content: "''", // need double quotes otherwise wont' work?
      display: "table",
      clear: "both",
    },
    [theme.breakpoints.up("md")]: {
      // medium screens centered. 960 px
      padding: "2rem",
      "&:before": {
        left: "calc(50% - 1px)",
        right: "auto",
      },
    },
  },
  timelineItem: {
    padding: "1rem",
    borderBottom: "2px solid tan",
    position: "relative",
    margin: "1rem 3rem 1rem 1rem",
    clear: "both",
    "&:before": {
      content: "''",
      position: "absolute",
      right: "-0.625rem",
      top: "calc(50% - 5px)",
      borderStyle: "solid",
      borderColor: "tomato tomato transparent transparent",
      borderWidth: "0.625rem",
      transform: "rotate(45deg)",
    },
    "&:after": {
      content: "''",
      position: "absolute",
    },
    [theme.breakpoints.up("md")]: {
      width: "44%",
      margin: "1rem",
      float: "right",
      ":nth-of-type(2n)": {
        float: "right",
        margin: "1rem",
        borderColor: "tan",
      },
      ":nth-of-type(2n):before": {
        right: "auto",
        left: "-0.625rem",
        borderColor: "transparent transparent tomato tomato",
      },
    },
  },
  timelineYear: {
    textAlign: "center",
    maxWidth: "9.375rem",
    margin: "0 3rem 0 auto",
    fontSize: "1.8rem",
    background: "tomato",
    color: "white",
    lineheight: 1,
    padding: "0.5rem 1rem", // differs from his, is 0.5rem 0 1rem
    "&:before": {
      display: "none",
    },
    [theme.breakpoints.up("md")]: {
      textAlign: "center",
      margin: "0 auto",
      ":nth-of-type(2n)": {
        float: "none",
        margin: "0 auto",
      },
      ":nth-of-type(2n):before": {
        display: "none",
      },
    },
  },
  heading: {
    color: "tomato",
    padding: "3rem 0",
    textTransform: "uppercase",
  },
  subHeading: {
    color: "white",
    padding: "0",
    textTransform: "uppercase",
  },
}));

const Resume = () => {
  const classes = useStyles();
  return (
    <>
      <Navbar />
      <Box className={classes.mainContainer} component="header">
        <Typography className={classes.heading} variant="h4" align="center">
          software experience
        </Typography>

        <Box className={classes.timeline} component="div">
          <Typography
            className={`${classes.timelineYear} ${classes.timelineItem}`}
            variant="h2"
          >
            2013
          </Typography>

          <Box className={classes.timelineItem} component="div">
            <Typography
              className={classes.subHeading}
              variant="h5"
              align="center"
            >
              web design
            </Typography>
            <Typography
              variant="body1"
              align="center"
              style={{ color: "tomato" }}
            >
              company name
            </Typography>
            <Typography
              variant="subtitle1"
              align="center"
              style={{ color: "tan" }}
            >
              description here lorem lrem ipsum something somthieng
            </Typography>
          </Box>
        </Box>

        <Typography
          className={`${classes.timelineYear} ${classes.timelineItem}`}
          variant="h2"
        >
          2014
        </Typography>
        <Box className={classes.timelineItem} component="div">
          <Typography
            className={classes.subHeading}
            variant="h5"
            align="center"
          >
            anothing thing
          </Typography>
          <Typography
            variant="body1"
            align="center"
            style={{ color: "tomato" }}
          >
            company
          </Typography>
          <Typography
            variant="subtitle1"
            align="center"
            style={{ color: "tan" }}
          >
            description here lorem lrem ipsum something somthieng
          </Typography>
        </Box>
      </Box>
    </>
  );
};

export default Resume;
